import firebaseConfig from "../firebaseConfig";

function handlerSignInWithFB(data) {
  firebaseConfig.firebase
    .database()
    .ref(`/${"truongthaingan19@gmail.com"}`)
    .set({
      username: "name",
      email: "truongthaingan19@gmail.com",
      id: "123",
    });
  return {};
}

export default handlerSignInWithFB;
